import  "./index.css"
import Product from "./components/product";

const products = fetch('https://fakestoreapi.com/products/1')
            .then(res=>res.json())
            .then(json=>console.log(json))

function App() {

  return (
    <div>
      <Product products = {products}/> 
    </div>
  )

}
export default App;
